import React from 'react';

export default function Header() {
  return (
    <>
      <header>
        <div className="upper-section">
          <div className="number">
            <span>(52) 55 054 548 064</span>
          </div>
          <div className="social-media">
            <img src="/facebook.png" alt="Facebook icon" />
          </div>
        </div>
      </header>
    </>
  );
}
